pragma solidity ^0.8.17;

contract Ethazon {

    struct EthazonOrder {
        bool isValidEthazonOrder;
        string customerName;
        string shippingAddress;
        bool hasConfirmed;
    }

    mapping(address => uint256) public balances;
    mapping(address => EthazonOrder) public orders;

    modifier validOrder(address _sender) {
        require(orders[_sender].isValidEthazonOrder, "No valid order");
        _;
    }

    modifier notConfirmed(address _sender) {
        require(!orders[_sender].hasConfirmed, "Order already confirmed");
        _;
    }

    modifier canMakeOrder(address _sender) {
        require(!orders[_sender].isValidEthazonOrder || orders[_sender].hasConfirmed, "Cannot make another order");
        _;
    }

    function makeOrder(string memory _customerName, string memory _shippingAddress) public payable canMakeOrder(msg.sender) {
        orders[msg.sender] = EthazonOrder(true, _customerName, _shippingAddress, false);
        balances[address(this)] += msg.value;
    }

    function confirmOrder() public validOrder(msg.sender) notConfirmed(msg.sender) {
        orders[msg.sender].hasConfirmed = true;
    }

    function cancelOrder() payable public validOrder(msg.sender) {
        if (orders[msg.sender].hasConfirmed) {
            orders[msg.sender].hasConfirmed = false;
        } else {
            orders[msg.sender].isValidEthazonOrder = false;
            balances[address(this)] -= msg.value;
            payable(msg.sender).transfer(msg.value);
        }
    }

    function withdraw() public {
        require(balances[msg.sender] > 0, "No balance to withdraw");
        uint256 amount = balances[msg.sender];
        balances[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
    }
